import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int t = 1;
        while (t-- > 0) {
            int n = scanner.nextInt();
            int k = scanner.nextInt();
            int[] s = new int[k];
            int[][] b = new int[n][k];
            for (int i = 0; i < k; i++) {
                s[i] = scanner.nextInt();
            }
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < k; j++) {
                    b[i][j] = scanner.nextInt();
                }
            }
            boolean flag = true;
            int[] sum = new int[k];
            for (int i = 0; i < k; i++) {
                for (int j = 0; j < n; j++) {
                    sum[i] += b[j][i];
                }
            }
            for (int i = 0; i < k; i++) {
                if (sum[i] < s[i]) {
                    flag = false;
                    break;
                }
            }
            if (flag) {
                System.out.println("Yes");
            } else {
                System.out.println("No");
            }
        }
    }
}
